const { CREATE_EVENTS, GET_ALL_EVENTS } = require("../constants/actionType");

/* const initialState = {
      
}; */


const eventsReducer = (events=[],{type,payload}) => {

      switch (type) {


            case GET_ALL_EVENTS:
                  
                  return {...events,
                  payload};
            case CREATE_EVENTS:
                  
                  return events;
            
      
            default:
                  return events;
      }
      
}

export default eventsReducer;
